import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <footer className="footer">
      <p>&copy; 2025 <a href="https://logannitzsche.com" target="_blank" rel="noopener noreferrer">Logan Nitzsche</a></p>
    </footer>
  );
};

export default Footer;
